import React from "react";
import ".FriendCard.css";

const Friend = (props) => (
  <div className="card">
    <div className="img-container">
      <img
        alt={props.name}
        src={props.image}
      />
    </div>
    <div className="name">
      <strong>Name:</strong> {props.name}
    </div>
  </div>
)

export default Friend;
